BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "zaposleni" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,
	"ime"	TEXT NOT NULL,
	"priimek"	TEXT NOT NULL,
	"vloga"	TEXT NOT NULL,
	"zaposlen_let"	INTEGER NOT NULL DEFAULT 0,
	"stavba_id"	INTEGER DEFAULT NULL,
	FOREIGN KEY("stavba_id") REFERENCES "stavba"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "stavba" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT UNIQUE,
	"naziv"	TEXT NOT NULL,
	"kapaciteta"	INTEGER NOT NULL DEFAULT 0,
	"studio_id"	TEXT,
	FOREIGN KEY("studio_id") REFERENCES "studio"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "studio" (
	"id"	TEXT NOT NULL UNIQUE,
	"naziv"	TEXT NOT NULL,
	"naslov"	TEXT,
	"www"	TEXT NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "blagajna" (
	"film_id"	INTEGER NOT NULL UNIQUE,
	"proracun"	INTEGER,
	"prihodek_zda"	INTEGER,
	"prihodek_svet"	INTEGER,
	CONSTRAINT "FK_film_blagajna" FOREIGN KEY("film_id") REFERENCES "film"("id") ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS "film" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"naslov"	TEXT NOT NULL,
	"reziser"	TEXT NOT NULL,
	"studio_id"	TEXT NOT NULL,
	"leto"	INTEGER NOT NULL,
	"dolzina"	INTEGER NOT NULL,
	"ocena"	REAL
);
COMMIT;
